import React from "react";
import styled from "styled-components";


const Completed = styled.div`
  text-decoration: line-through;
`;

const Track = ({track}) => {
  return (
      <div className={track.complete ? "strike" : ""}>
          {track.title}
      </div>
  );
};

export default Track;
